import React from "react";

const Anime = (props) => {
  const topAnime = props.animeData.filter((x) => x.rank <= 5);
  const topAnimeList = topAnime.map((x) => {
    return <li>{x.title}</li>;
  });

  return (
    <div>
      <div> Currently Trending Anime:</div>
      <ul>{topAnimeList}</ul>
    </div>
  );
};
export default Anime;
